import React from 'react';

const StyliLogo = ({ width = 70, height = 40, className = "" }) => {
  return (
    <svg 
      xmlns="http://www.w3.org/2000/svg" 
      width={width} 
      height={height} 
      viewBox="0 0 200 80" 
      title="styli logo" 
      className={className}
    >
      {/* Arabic text above */}
      <text 
        x="100" 
        y="25" 
        textAnchor="middle" 
        fontSize="14" 
        fontFamily="Arial, sans-serif" 
        fill="black"
        fontWeight="normal"
      >
        ستايلي
      </text>

      {/* English "styli" text below */}
      <text 
        x="100" 
        y="55" 
        textAnchor="middle" 
        fontSize="24" 
        fontFamily="Arial, sans-serif" 
        fill="black"
        fontWeight="bold"
        textTransform="lowercase"
      >
        styli
      </text>
    </svg>
  );
};

export default StyliLogo;
